// src/data/skills.js
export const skills = [
  {
    name: "React",
    logo: "../../logo.svg",
    years: 3,
    description: "Front-end JavaScript library for building UIs.",
    projects: [
      { title: "Smoll URL", link: "https://example.com/portfolio" },
      { title: "E-commerce App", link: "https://example.com/shop" }
    ]
  },
  {
    name: "Node.js",
    logo: "https://nodejs.org/static/images/logo.svg",
    years: 2,
    description: "JavaScript runtime built on Chrome's V8 engine.",
    projects: [
      { title: "API Service", link: "https://example.com/api" },
      { title: "Real-time Chat", link: "https://example.com/chat" }
    ]
  },
  {
    name: "Python",
    logo: "https://www.python.org/static/community_logos/python-logo.png",
    years: 4,
    description: "High-level programming language for general-purpose programming.",
    projects: [
      { title: "Data Analysis Tool", link: "https://example.com/data-tool" },
      { title: "Web Scraper", link: "https://example.com/scraper" }
    ]
  }
];
